The laughter ride starts with Raju wearing the mask of Kapil and opening the show. One by one all the family members come on the stage wearing the mask of Kapil. Later, Kapil comes on the stage and asks them to get lost. Kapil then speaks about the Sajjid Khan, the director of the new movie, Humshakals and welcomes him on the stage. Kapil then speaks to Sajjid Khan about the plot of the movie, Humshakals. One by one the cast of the movie, Ritiesh Deshmukh, Saif Ali Khan and Ram Kapoor appear on the stage. Watch the laugh riot that takes place on the stage and have a laugh.

